import React, { useState } from 'react';

import Selectplan from './Selectplan';
import Form from './Form';

export default function Finalform() {
  const [isSubmitted, setIsSubmitted] = useState(false);
  function submitForm() {
    setIsSubmitted(true);
  }
  return;
}
